import React from './node_modules/react';
import PropTypes from './node_modules/prop-types';

const Question =(props)=> {
    return (
        <h2 className='question'>{props.content}</h2>
    );
}

Question.propTypes = {
    content: PropTypes.string.isRequired
};

export default Question;
